import { uuid } from "uuid"
export const addTweet = ({
    id = uuid(),
    name = "",
    tweeted_date = Date.now,
    comments = 0,
    retweets = 0,
    likes = 0,
} = {}) => ({
    type: "ADD_TWEET",
    tweet_payload: {
        id,
        name,
        tweeted_date,
        comments,
        retweets,
        likes,
    },
})
